import React from 'react';
import { directive } from '@babel/types';

const Movie = () => {
    return(
        <div className="video-container">
            <video className="video-player" autoPlay muted controlsList="nodownload" crossOrigin="anonymous" loop playsInline preload="metadata">
                <source id="mp4" src="../vid-one.mp4" type="video/mp4; codecs=hevc" />
                <source id="webm" src="../vid-one.mp4" type="video/mp4" />
            </video>
        </div>
    )
}

export default Movie;
